import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
    return (
        <div className="">
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <a className="navbar-brand ml-3" href="https">Logo</a>
                {/* <Link className="text-light text-center"> Upload Your Image</Link> */}
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse justify-content-end" id="navbarNavAltMarkup">
                    <div className="navbar-nav row">
                        {/* <a className="nav-link active" href="#">Home <span className="sr-only">(current)</span></a>
                        <a className="nav-link" href="#">Features</a>
                        <a className="nav-link" href="#">Pricing</a>
                        <a className="nav-link disabled" href="#" aria-disabled="true">Disabled</a> */}
                        
                        <button className="btn btn-outline-success mr-2" type="button"><Link className="">Sign In</Link></button>
                        <button className="btn btn-primary mr-5"><Link className="text-light">Sign Up</Link></button>
                    </div>
                </div>
            </nav>
        </div>
    );
};

export default Navbar;
